const handleSubmit = async (event) => {
  event.preventDefault();
  try {
    const response = await axios.post("http://localhost:5000/api/data", {
      name,
      age: parseInt(age, 10),
    });
    console.log("Data added:", response.data);
    setName("");
    setAge("");
  } catch (error) {
    console.error("Error adding data:", error);
  }
};
